import React from 'react';
import Navigation from './Navigation';

const Layout = ({ children }) => {
    return (
        <div style={styles.container}>
            <div style={styles.sidebar}>
                <Navigation />
            </div>
            <div style={styles.content}>
                {children}
            </div>
        </div>
    );
};

const styles = {
    container: {
        display: 'flex',
        height: '100vh',
    },
    sidebar: {
        width: '250px',
        backgroundColor: '#333',
        color: 'white',
        padding: '20px',
    },
    content: {
        flex: 1,
        padding: '20px',
    },
};

export default Layout;
